import React, { Component } from 'react'

export default class register extends Component {
  render() {
    return (
      <div><h1>Show Data</h1>
     <Table striped bordered hover>
  <thead>
    <tr>
      <th>First Name</th>
      <th>Last Name</th>
      <th>Username</th>
    </tr>
  </thead>
  <tbody>

     {
       this.props.data.map( item => {
         return (
          <tr>
        <td>{item.username}</td>
        <td>{item.email}</td>
        <td>{item.password}</td>
        </tr>
         )
       })
     }

  </tbody>
</Table>

      </div>
    )
  }
}
